import React, {Component, createRef} from 'react';
import Menu from '../layout/Menu';

const NavPanel = (props: Props) => { 
  let navPanelClasses = 'navigation-navpanel';
  const { isOpen } = props;
  const { items } = props;
  if(isOpen){
    navPanelClasses = 'navigation-navpanel open';
  }
  else{
    navPanelClasses = 'navigation-navpanel '
  }
  return(
    <div className="NavPanel-Component">
      <nav className={navPanelClasses} id="navigation-navpanel"> </nav>
        <Menu items={items}/>

    </div>
  );
}

type MyProps = {
  isOpen: boolean;
  items: [];
};

type Props = MyProps;

export default NavPanel;



